import "./aboutServices.css";
import AboutLeft from "./AboutLeft";
import AboutRight from "./AboutRight";
import Form from "./Form";
import exhibiton from  "../img/exhibition.png"
import office from "../img/OfficeBranding.png";
import sign from "../img/sign.png";
import signboard from "../img/signboard.png";
import corporate from "../img/corporate.png";
import printing from "../img/printing.png";
function AboutServices() {
  return (
    <> <div className="container">
      <div className="services-container">
      <div className="service-item">
        <img src={exhibiton} alt="Exhibition Stands" style={{height:"100px", width: "100px"}}/>
        <h3>Exhibition Stands</h3>
      </div>
      <div className="service-item">
        <img src={office} alt="Showroom & Office Branding"style={{height:"100px", width: "100px"}} />
        <h3>Showroom & Office Branding</h3>
      </div>
      <div className="service-item">
        <img src={sign} alt="Signages Indoor & Outdoor"style={{height:"100px", width: "100px"}} />
        <h3>Signages Indoor & Outdoor</h3>
      </div>
      <div className="service-item">
        <img src={signboard} alt="Retail Branding & Displays"style={{height:"100px", width: "100px"}} />
        <h3>Retail Branding & Displays</h3>
      </div>
      <div className="service-item">
        <img src={corporate} alt="Corporate Events Branding"style={{height:"100px", width: "100px"}} />
        <h3>Corporate Events Branding</h3>
      </div>
      <div className="service-item">
        <img src={printing} alt="Large Format Printing"style={{height:"100px", width: "100px"}} />
        <h3>Large Format Printing</h3>
      </div>
    </div>
    </div>
   
    </>
  );
}

export default AboutServices;
{/* */}
